import React from 'react';

const trendingData = [
  {
    Date: '4-Jul-25',
    Symbol: 'AICL-JUL',
    Code: '40',
    'Company Name': 'Adamjee Ins.',
    'Open Price': '59.89',
    'High Price': '63.36',
    'Low Price': '58',
    'Close Price': '62.57',
    Volume: '615000',
    'Previous Close': '57.6'
  },
  // You can add more stocks with the same structure
];

const TrendingStocks = () => {
  return (
    <div style={styles.container}>
      <h2 style={styles.header}>ðŸ”¥ Trending Stocks</h2>
      <div style={styles.grid}>
        {trendingData.map((stock, index) => (
          <div key={index} style={styles.card}>
            /*<h3>{stock.Symbol}</h3>
            <p><strong>Date:</strong> {stock.Date}</p>
            <p><strong>Code:</strong> {stock.Code}</p>
            <p><strong>Company Name:</strong> {stock['Company Name']}</p>
            <p><strong>Open Price:</strong> {stock['Open Price']}</p>
            <p><strong>High Price:</strong> {stock['High Price']}</p>
            <p><strong>Low Price:</strong> {stock['Low Price']}</p>
            <p><strong>Close Price:</strong> {stock['Close Price']}</p>
            <p><strong>Previous Close:</strong> {stock['Previous Close']}</p>
            <p><strong>Volume:</strong> {stock.Volume}</p>
          </div>
        ))}
      </div>
    </div>
  );
};

const styles = {
  container: {
    padding: '30px',
    maxWidth: '1000px',
    margin: '0 auto',
    fontFamily: 'Arial, sans-serif',
  },
  header: {
    textAlign: 'center',
    marginBottom: '20px',
  },
  grid: {
    display: 'grid',
    gridTemplateColumns: 'repeat(auto-fill, minmax(250px, 1fr))',
    gap: '20px',
  },
  card: {
    backgroundColor: '#000000ff',
    color: 'white',
    borderRadius: '10px',
    padding: '15px',
    boxShadow: '0 4px 8px rgba(0,0,0,0.1)',
    textAlign: 'left',
  },
};
export default TrendingStocks;
